import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import notes from "../notes";

function App() {
    return (
        <div>
            <Header />
            {notes.map((entry) => (
                <Note
                    title={entry.title}
                    content={entry.content}
                />
            ))}
            <Footer />
        </div>
    );
}

export default App;
